import React from 'react';
//import axios from 'axios';
import $ from 'jquery';
class UserName extends React.Component{
    constructor(props) {
    super(props);
    this.state = {
        online_name: '',
        username: '',
        githubUrl: '',    
        avataUrl: '',
        follwers: '',
        place: '',
    }
  }
  componentDidMount() {
    $.get(this.props.source, (result) => {
           console.log(result);
           const data = result;
           if (data){
               this.setState({
                   online_name: data.login,
                   username: data.name,
                   place: data.location,
                   githubUrl: data.html_url,
                   avataUrl: data.avatar_url,
                   followers: data.followers,
               });
           }
      });
  }

}
export default function UserNames(){
      return(

          <div>
              <p>ID:{UserName.state.online_name}</p>
              <h3>{UserName.state.username}</h3>
              <img src={UserName.state.avataUrl} /><p/>
              <a>location:{UserName.state.place}</a>
              <p>followers: {UserName.state.followers}</p>
              <a href={UserName.state.githubUrl}>Github Link </a>
           </div>

      );

}
